/* 슬라이드 조절하는 부분 */

import React from 'react';

import { StyledTrack } from './StyledComponents';

type TrackProps = {
  source: {
    id: string;
    value: number;
    percent: number;
  };
  target: {
    id: string;
    value: number;
    percent: number;
  };
  /* getTrackProps: () => any; */
  color?: string;
};

const Track: React.FC<TrackProps> = ({
  source,
  target,
  /* getTrackProps, */
  color,
}) => (
  <StyledTrack
    sourcePercent={source.percent}
    targetPercent={target.percent}
    /* {...getTrackProps()} */
    /* color={color} */
  />
);

export default Track;
